import React from "react";
import Footer from "./footer";
import todosData from "./components/todoData"
import Product from "./components/Product"

const App = () => {

    const theData = todosData.map(data => <Product text={data.text} status={data.completed} />)

    return (
        <div>
            <h1>Babajide</h1>
            <p>I am the best</p>

            {theData}


            <Footer />
        </div>
    )
};

export default App;
